  handlePress(target, owner) {
    if (this.props.onPress) {
      let name
      let id
      let index = -1
      if (target.search('::') > -1) {
        const varCount = target.split('::').length
        if (varCount === 2) {
          name = target.split('::')[0]
          id = target.split('::')[1]
        } else if (varCount === 3) {
          name = target.split('::')[0]
          index = parseInt(target.split('::')[1])
          id = target.split('::')[2]
        }
      } else {
        name = target
      }
      this.props.onPress({
        type: 'button',
        name: name,
        index: index,
        id: id,
        owner: owner,
      })
    }
  }

  handleChangeTextinput(name, value) {
    let id
    let index = -1
    if (name.search('::') > -1) {
      const varCount = name.split('::').length
      if (varCount === 2) {
        name = name.split('::')[0]
        id = name.split('::')[1]
      } else if (varCount === 3) {
        name = name.split('::')[0]
        index = name.split('::')[1]
        id = name.split('::')[2]
      }
    } else {
      name = name
    }
    let state = this.state
    state[name.split('::').join('')] = value
    this.setState(state, () => {
      if (this.props.onChange) {
        this.props.onChange({
          type: 'textinput',
          name: name,
          value: value,
          index: index,
          id: id,
        })
      }
    })
  }

